import React, {useContext} from 'react';
import './Navbar.css';
// Traemos las rutas
import { Link } from 'react-router-dom';
// Import context
import { CartContext } from '../../Context/Context';
import { MdShoppingCart } from "react-icons/md";


export default function Navbar() {

    const [cart ] = useContext(CartContext)

    return (

        <nav className ="menu">

        <div>
            <div className="Navtop">
            <Link to={"/"}><h1 className="titulo-principal">Tienda </h1></Link>
        <input type="text"  placeholder="Buscar" className="Busqueda"/>
        <button className="BtnBusqueda">Buscar</button>



        <Link to = {"/Cart/"}>
        <MdShoppingCart className="cart"/>
        </Link>

        </div>


       <div>
        <ul className="lista">
        <Link className='links' to='/'>home</Link>
            <Link className='links' to='/Categories'>categories</Link>
            <Link className='links' to='/ShoppingCart'>cart {cart.length}</Link>
            <Link className='links' to='/CheckOut'>checkout</Link>

        </ul>

        </div>

        {/* <button onClick={props.Nosotros} className="btn">Nosotros </button> */}


        </div>

    </nav>


    )
}
